import React from 'react';
import { Layout, Table } from 'antd';
import COLUMNS from './column-content';
import DATA from './data';

const { Content } = Layout;
const rowSelection = {
  onChange: (selectedRowKeys, selectedRows) => {
    console.log(
      `selectedRowKeys: ${selectedRowKeys}`,
      'selectedRows: ',
      selectedRows,
    );
  },

};

const BookingContent = () => {

  return (
    <Layout style={{ padding: '0 24px 24px' }}>
      <Content style={{
        padding: 24,
        margin: 0,
        minHeight: 600,
      }}
      >
        <div>
          <Table
            pagination={false}
            tableLayout="fixed"
            rowSelection={{
              ...rowSelection,
            }}
            scroll={{ x: 2000 }}
            title={() => 'Booking Pages'}
            dataSource={DATA}
            columns={COLUMNS}
          />
        </div>
      </Content>
    </Layout>
  );
};

export default BookingContent;
